select(2, ...).LoadData("APP_INFO","Global",[[return {version=404,lastSync=1599980357,message={id=0,msg=""},news={{title="TSM 4.10 Launch & Team Q&A",content="TSM 4.10 launched as announced this past Sunday, which is a huge milestone for the TSM Team! We're so glad that feedback has been overwhelmingly positive, and thankfully after a stable beta the release was stable too! If you haven't already, you can check out the full Change Log here. As part of the launch, [...]",timestamp=1599581570,link="https://blog.tradeskillmaster.com/tsm-4-10-launch-team-qa/"},{title="TradeSkillMaster v4.10.3 Changelog",content="TSM v4.10.3 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Welcome to TradeSkillMaster 4.10! Full changelog: http://support.tradeskillmaster.com/display/KB/Change+Log<br />* The Import Summary dialog now supports deselecting subgroups which you don't want imported<br />* The SaleRate price source is now limited to the last 180 days<br />* Fixed various errors at login<br />* Fixed error when deleting old Accounting data<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1599510134,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-3-changelog/"},{title="TradeSkillMaster v4.10.2 Changelog",content="TSM v4.10.2 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Welcome to TradeSkillMaster 4.10! Full changelog: http://support.tradeskillmaster.com/display/KB/Change+Log<br />* Fixed error when switching profiles<br />* Fixed error some users from Chile were seeing<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1599426344,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-2-changelog/"},{title="TradeSkillMaster v4.10.1 Changelog",content="TSM v4.10.1 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Welcome to TradeSkillMaster 4.10! Full changelog: http://support.tradeskillmaster.com/display/KB/Change+Log<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1599413439,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-1-changelog/"},{title="TradeSkillMaster v4.10 Changelog",content="TSM v4.10 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1599411749,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-changelog/"},{title="TSM 4.10 Release Date!",content="The TradeSkillMaster 4.10 Beta is sadly drawing to a close, but that means the public release is imminent! Over the last 7 weeks, we have had more than 10,000 beta participants, who shared 8,500 comments or pieces of feedback and received a total of 15 addon updates containing 250 individual additions, changes or fixes. In [...]",timestamp=1598913297,link="https://blog.tradeskillmaster.com/tsm-4-10-release-date/"}}}]]) --<APP_INFO,Global,1599980357>
